import logging
import json
from typing import List

logging.basicConfig(level=logging.INFO, format='%(asctime)s - %(levelname)s - %(message)s')

class FileProcessor:
    def __init__(self):
        self.database = {}

    def validate_fabs_file(self, file_path: str) -> bool:
        try:
            with open(file_path, 'r') as file:
                content = file.read()
                if content:
                    return True
                else:
                    logging.warning('FABS file is empty')
                    return False
        except FileNotFoundError:
            logging.error('FABS file not found')
            return False

    def process_fabs_file(self, file_path: str) -> None:
        if self.validate_fabs_file(file_path):
            with open(file_path, 'r') as file:
                content = file.read()
                self.database[file_path] = json.loads(content)
                logging.info(f'FABS file {file_path} processed successfully')

    def validate_dabs_file(self, file_path: str) -> bool:
        try:
            with open(file_path, 'r') as file:
                content = file.read()
                if content:
                    return True
                else:
                    logging.warning('DABS file is empty')
                    return False
        except FileNotFoundError:
            logging.error('DABS file not found')
            return False

    def process_dabs_file(self, file_path: str) -> None:
        if self.validate_dabs_file(file_path):
            with open(file_path, 'r') as file:
                content = file.read()
                self.database[file_path] = json.loads(content)
                logging.info(f'DABS file {file_path} processed successfully')

    def load_fpds_data(self, data_source: str) -> dict:
        try:
            with open(data_source, 'r') as file:
                return json.load(file)
        except FileNotFoundError:
            logging.error('FPDS data source not found')
            return {}

    def retrieve_fabs_submissions(self) -> List[str]:
        return [key for key in self.database if key.endswith('.fabs')]

    def retrieve_fpds_data(self) -> dict:
        return self.load_fpds_data('fpds_data.json')

    def retrieve_dabs_submissions(self) -> List[str]:
        return [key for key in self.database if key.endswith('.dabs')]

class FABSManager:
    def __init__(self, file_processor: FileProcessor):
        self.file_processor = file_processor

    def submit_fabs_file(self, file_path: str) -> None:
        self.file_processor.process_fabs_file(file_path)

class DABSManager:
    def __init__(self, file_processor: FileProcessor):
        self.file_processor = file_processor

    def submit_dabs_file(self, file_path: str) -> None:
        self.file_processor.process_dabs_file(file_path)

def main():
    file_processor = FileProcessor()
    fabs_manager = FABSManager(file_processor)
    dabs_manager = DABSManager(file_processor)

    fabs_manager.submit_fabs_file('example.fabs')
    dabs_manager.submit_dabs_file('example.dabs')

    print(file_processor.retrieve_fabs_submissions())
    print(file_processor.retrieve_fpds_data())
    print(file_processor.retrieve_dabs_submissions())

if __name__ == '__main__':
    main()
